import { GET_CITYS, FETCHING_DATA, FETCH_DATA_SUCCESS } from './../constants/types';
import callAPI from './../common/callApi';

export const getCity = () => dispatch => {
    dispatch({
        type: FETCHING_DATA
    });
    callAPI('/getCitys', 'GET', null)
        .then(res => {
            dispatch({
                type: GET_CITYS,
                payload: res.data
            });
            dispatch({
                type: FETCH_DATA_SUCCESS
            });
        });
};
